import React from 'react'
import {useDispatch, useSelector} from 'react-redux';
import { signIn } from '../reducks/users/operations';

function Login() {
  const dispatch = useDispatch()

  return (
    <div>
      <h2>ログイン</h2>
      <button onClick={() => dispatch(signIn())}>
        ホーム画面へ
      </button>
    </div>
  )
}

export default Login
